import randomimport torchimport numpy as npdef fix_seed(random_seed):    random.seed(random_seed)    np.random.seed(random_seed)    torch.manual_seed(random_seed)    torch.cuda.manual_seed(random_seed)    torch.cuda.manual_seed_all(random_seed)    torch.backends.cudnn.deterministic = True    torch.backends.cudnn.benchmark = False    print("Random Seed: {}".format(random_seed))